import React from 'react'

const Home = ({joiningLobby, createLobby, joinLobby, handleRoomJoinText}) => {

    handleRoomJoinText = this.props.handleRoomJoinText;
    joinLobby = this.props.joinLobby;

    return(
        (joiningLobby)
        ?   <>
                <input
                    type='text'
                    onChange={this.handleRoomJoinText}/>
                <button onClick={this.joinLobby}>Submit</button>
            </>
        :   <>
                <button onClick={createLobby}>Create Lobby</button>
                <button onClick={joinLobby}>Join Lobby</button>
            </>
    )
}

export default Home
